import React from 'react';
import Common from './Common';
import img from './images/home1-slider.png';


const About = () => {
    return(
        <>
        <Common
            name="Welcome to About page"
            imgsrc={img}
            visit="/contact"
            btname="Contact us"
        />
        </>
    );
}

export default About;
